let mutable memoize = Map.empty<(Piece list * Cube), string>
let matchesPieces (pieces: Piece list) (cube: Cube) (pattern: string, _: bool, _: bool) =
    match Map.tryFind (pieces, cube) memoize with
    | Some key -> key = pattern
    | None ->
        let key = Render.piecesToString cube pieces
        memoize <- Map.add (pieces, cube) key memoize
        key = pattern

